question:
Olgu $z = 2 + \sqrt{2} - (3 + 3 \sqrt{2})i$ ja olgu $c = 2 - 3i$. Olgu $w$ tulemuseks, kui $z$ pööratakse ümber $c$ $\frac{\pi}{4}$ radiaani vastupäeva.

[asy]
unitsize(0.6 cm);

pair C, W, Z;

Z = (2 + sqrt(2), -3 - 3*sqrt(2));
C = (2,-3);
W = rotate(45,C)*(Z);

draw(Z--C--W);

dot("$c$", C, N);
dot("$w$", W, SE);
dot("$z$", Z, S);
label("$\frac{\pi}{4}$", C + (0.6,-1));
[/asy]

Leia $w.$

response:
Koordinaattien muunnokset laitsivat eri pisteiden koordinaattien avulla. Olkoon $z = x + yi$ ja $c = a + bi.$

\begin{align*}
x &= a + c \cos \theta, \\
y &= b + c \sin \theta.
\end{align*}

Tässä $\theta$ on piste $z$ vastapäeva piste $c$ yhdellä puolella. Tässä tapauksessa $\theta = \frac{\pi}{4}.$

Koska $z = 2 + \sqrt{2} - (3 + 3 \sqrt{2})i$ ja $c = 2 - 3i,$ niin

\begin{align*}
x &= 2 + (2 - 3i) \cos \frac{\pi}{4} = 2 + (2 - 3i) \cdot \frac{\sqrt{2}}{2} = 1 + \sqrt{2} - \frac{3}{2} \sqrt{2} i, \\
y &= -3 - (3 + 3 \sqrt{2})i \sin \frac{\pi}{4} = -3 - (3 + 3 \sqrt{2})i \cdot \frac{\sqrt{2}}{2} = -3 - \frac{3}{2} \sqrt{2} - \frac{3}{2} \sqrt{2} i.
\end{align*}

Tässä $w = x + yi = \boxed{1 + \sqrt{2} - 3i - 3 \sqrt{2} i}.$

